- input: "TEXT\x1CC00167213\x1C.TEXT\x1C\x1CF3XA\x1CTHIS AMENDED REPORT IS SUBMITTED
    TO REPORT AN UNREPORTED CONTRIBUTION, AND TO REPORT THREE OMITTED DISBURSEMENTS.
    \  Second Amendment -- The committee has had problems with its Levin Schedule
    L.  At the time of this second amendement the Schedule L would not open.  This
    Memo was added to provide information requested in the FEC letter of 2-4-09 requesting
    additional information about the 10-31-08 Levin Account Expenditure.  The funds
    were spent on an activity (independent expenditure) which was lawful under the
    laws of Oklahoma.  It paid for the preparation and mailing of a brochure which
    opposed the election of a state candidate.  It was made by and under the direction
    of the state party.  It was not coordinated with any state candidate and complied
    with the rules of the State of Oklahoma.   This memo text is submitted until help
    can be received in getting the Levin Schedule L to open.\n"
